import { Repository } from 'models/Repository';
import React from 'react';
import { Card, Image } from 'semantic-ui-react';
import './_RepositoryCard.css';

const RepositoryCard: React.FC<
  Pick<Repository, 'name' | 'owner' | 'full_name' | 'description'>
> = ({ name, owner, full_name, description }) => (
  <Card className="repositoryCard">
    <Card.Content>
      <Image floated="right" size="mini" src={owner.avatar_url} />
      <Card.Header>{name}</Card.Header>
      <Card.Meta>{full_name}</Card.Meta>
      <Card.Description>{description}</Card.Description>
    </Card.Content>
  </Card>
);
export default RepositoryCard;
